import React, { useEffect, useState } from "react";
import API from "../api";
import ChannelList from "../components/ChannelList";
import OnlineList from "../components/OnlineList";
import NewChannelModal from "../components/NewChannelModal";
import { useNavigate } from "react-router-dom";
    
export default function Channels({ user, setUser }) {
  const [channels, setChannels] = useState([]);
  const [online, setOnline] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const nav = useNavigate();

  useEffect(() => {
    load();
  }, []);

  const load = async () => {
    try {
      const { data } = await API.get("/channels");
      setChannels(data);
    } catch (err) {
      console.error(err);
    }
  };

  const onCreate = (c) => setChannels(prev => [c, ...prev]);

  const logout = () => {
    localStorage.clear();
    setUser(null);
    nav("/login");
  };

  return (
    <div className="app">
      <div className="container">
        <aside className="sidebar">
          <div className="brand">
            <div className="logo">MC</div>
            <div>
              <h3>Mini Chat</h3>
              <div className="text-muted">Channels & members</div>
            </div>
          </div>

          <div className="controls" style={{display:'flex',gap:8,marginTop:8}}>
            <button className="btn" onClick={()=>setShowModal(true)}>+ New Channel</button>
            <button className="ghost" onClick={load}>Refresh</button>
          </div>

          <ul className="channel-list">
            <ChannelList channels={channels}/>
          </ul>

          <div className="online">
            <OnlineList online={online}/>
          </div>

          <div style={{marginTop:12}}>
            <div style={{display:'flex',alignItems:'center',gap:10}}>
              <div className="avatar">{user.name?.charAt(0).toUpperCase()}</div>
              <div>
                <div style={{fontWeight:700}}>{user.name}</div>
                <div className="text-muted" style={{fontSize:12}}>{user.email}</div>
              </div>
            </div>
            <div style={{marginTop:10}}>
              <button className="ghost" onClick={logout}>Logout</button>
            </div>
          </div>
        </aside>

        <main className="main">
          <div className="header">
            <h2>Welcome, {user.name}</h2>
            <div className="sub">Select a channel to start chatting</div>
          </div>

          <div style={{flex:1,display:'flex',alignItems:'center',justifyContent:'center'}}>
            <div className="text-muted">Choose or create a channel to begin.</div>
          </div>
        </main>
      </div>

      {showModal && <div><div className="overlay" onClick={()=>setShowModal(false)}/><NewChannelModal onClose={()=>setShowModal(false)} onCreate={onCreate} /></div>}
    </div>
  );
}
